// src/App.js
import React from 'react';
import { createTheme, ThemeProvider, CssBaseline, Container } from '@mui/material';
import StockChart from './components/StockChart';  // Create StockChart component

const darkTheme = createTheme({
  palette: {
    mode: 'dark',
  },
});

function App() {
  return (
    <ThemeProvider theme={darkTheme}>
      <CssBaseline />
      <Container>
        <h1>Stock Trading Dashboard</h1>
        <StockChart />
      </Container>
    </ThemeProvider>
  );
}

export default App;
